import React from 'react';

const JapaneseRestaurant = () => {
    return (
        <div className="japanese-restaurant">
            <h1><img src="https://i.pinimg.com/474x/23/bd/70/23bd704ab06677f0c6227a2b6776c180.jpg" alt="Elegant Japanese dining setup with traditional dishes"/>
                Watanabe S and Grill
            </h1>
            <h2>A Journey Through Traditional Japanese Flavors</h2>
            <h2>Experience the Harmony of Fresh Ingredients and Artisanal Craftsmanship</h2>
        </div>
    );
};

export default JapaneseRestaurant;
